pragma solidity ^0.8.5;
import "./ChainLinkOracle.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
/**
 * @dev _Available since v1.0
 */
contract FeeManager is Pausable(), Ownable {
    uint256 private SERVICE_FEE = 1;
    uint256 private SERVICE_FEE_CANCEL = 2;
    uint256 private SERVICE_FEE_ACCEPT = 2;
    address payable holder;
    ChainLinkOracle private oracle;

    event Oracle(
        address indexed oracle
    );
    event Holder(
        address indexed holder
    );

    event Fee(
        uint256 indexed fee,
        uint256 indexed _cancelFee,
        uint256 indexed _acceptFee
    );

    /**
    * NOTE: _acceptFee is the amount in USD that de user pay to use this function, only de owner can change this amount
    * by default is 2 USD
    * Requirements:
    * @param _acceptFee is the amount in USD
    */
    function setAcceptFee(uint256 _acceptFee) public onlyOwner  returns(bool) {
        SERVICE_FEE_ACCEPT = _acceptFee;
        emit Fee(SERVICE_FEE,SERVICE_FEE_CANCEL,SERVICE_FEE_ACCEPT);
        return true;
    }
    /**
    *NOTE: _cancelFee
    *
    */
    function setCancelFee(uint256 _cancelFee) public onlyOwner  returns(bool) {
        SERVICE_FEE_CANCEL = _cancelFee;
        emit Fee(SERVICE_FEE,SERVICE_FEE_CANCEL,SERVICE_FEE_ACCEPT);
        return true;
    }

    /**
    *NOTE: _fee
    *
    */
    function setFee(uint256 _fee) public onlyOwner returns(bool) {
        SERVICE_FEE = _fee;
        emit Fee(SERVICE_FEE,SERVICE_FEE_CANCEL,SERVICE_FEE_ACCEPT);
        return true;
    }

    function acceptFee() public view returns(uint256) {
        return (oracle.getUSDPrice() / 100) * SERVICE_FEE_ACCEPT;
    }

    function cancelFee() public view returns(uint256) {
        return (oracle.getUSDPrice() / 100) * SERVICE_FEE_CANCEL;
    }

    function fee() public view returns(uint256) {
        return (oracle.getUSDPrice() / 100) * SERVICE_FEE;
    }

    function setHolder(address payable newHolder) public onlyOwner returns(bool) {
        holder = newHolder;
        emit Holder(holder);
        return true;
    }

    function setOracle(address newOracle) public onlyOwner returns(bool) {
        oracle = ChainLinkOracle(newOracle);
        emit Oracle(newOracle);
        return true;
    }

    function retriveFee() internal returns(bool) {
        holder.transfer(msg.value);
        return true;
    }
}

