// SPDX-License-Identifier: MIT
pragma solidity ^0.8.5;
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

contract ChainLinkOracle {
    AggregatorV3Interface internal priceFeed;
    address oracleAddressListen;

    constructor(address _oracleAddressListen)  {
        oracleAddressListen = _oracleAddressListen;
        priceFeed = AggregatorV3Interface(oracleAddressListen);
    }

    function getLatestPrice() public view returns (int) {
        (,int price,,,) = priceFeed.latestRoundData();
        return price;
    }

    function getUSDPrice() public view returns(uint256) {
        int weth_usd_price = getLatestPrice();
        return uint256(((1 * (10 ** 8)) * (1 * (10 ** 18))) / weth_usd_price);
    }

}

